import { useSelector } from "react-redux";
import { NavLink } from "react-router-dom";

const Navbar = () => {

  const {cart}= useSelector()
  return <div>

        <nav className="flex flex-row justify-between mx-auto h-20 maax-w-6xl items-center ">
          <NavLink to="/"><img src="" alt="err" /></NavLink>
            <div className="flex items-center  text-slate-100  row gap-3">
              <p>Home</p>
              <NavLink to="/cart">
              <p className="mx-5">Cart </p>
              <span> {cart.length}</span>
              </NavLink>
            </div>
        </nav>

  </div>;
};

export default Navbar;
